import './alpha-select.css';

const AlphaSelect = () => {

    const elements = [];

    for (let i = 0; i < 26; i++) {
        elements.push(<p key={i}>{String.fromCharCode(97 + i)}</p>);
    }

    return (
        <div className="alphaBox">
            {elements}
        </div>
    )
}

export default AlphaSelect;
